import React from "react";
import ReactDOM from "react-dom/client";
import "./index.css";
const loginData = [
  {
    logo: "https://img.icons8.com/?size=100&id=62&format=png&color=000000",
    name: "Login with Email",
  },
  {
    logo: "https://img.icons8.com/?size=100&id=V5cGWnc9R4xj&format=png&color=000000",
    name: "Login with Google",
  },
  {
    logo: "https://img.icons8.com/?size=100&id=uLWV5A9vXIPu&format=png&color=000000",
    name: "Login with FaceBook",
  },
  {
    logo: "https://img.icons8.com/?size=100&id=WWXOYwjdxZE8&format=png&color=000000",
    name: "Login with Apple",
  },
];
function App() {
  return (
    <div
      style={{
        border: "2px solid lightblue",
        Width: "10px",
        borderRadius: "5px",
        fontFamily: "Calibri",
      }}
    >
      <Header />
      <hr></hr>
      <Info />
      <Login />
      <Footer />
    </div>
  );
}
function Header() {
  return <h2 style={{ textAlign: "center" }}>Log in</h2>;
}
function Info() {
  return (
    <>
      <form>
        <div>
          <input
            type="text"
            placeholder="Phone Number Or Email Address"
            required
          />
        </div>
        <div>
          <input type="password" placeholder="password" required />
        </div>
      </form>
    </>
  );
}
function Login() {
  return (
    <main>
      <div className="menu">
        {loginData.map((option) => (
          <LoginOption login={option} key={option.name} />
        ))}
      </div>
    </main>
  );
}
function LoginOption(props) {
  return (
    <div>
      <span>{props.login.logo}</span>
      <div>
        <h3>{props.login.name}</h3>
      </div>
    </div>
  );
}
function Footer() {
  return (
    <p>
      Don't have an account?<a href="google.com">Create an Account</a>
    </p>
  );
}
const root = ReactDOM.createRoot(document.getElementById("root"));
root.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>
);

